Асистент пак може да ви помага за следното:

• да намирате отговори в мрежата;

• да получавате местна информация, като например за времето;

• да възпроизвеждате мултимедия и да управлявате устройствата си за интелигентен дом;

• да се забавлявате с шеги, игри и др.

Винаги можете да направите промени и по-късно от настройките в приложението Home или Асистент."

"Разрешете на Google Асистент да дава специфична за вас информация на новите отговарящи на условията устройства, които добавите към %1$s.

Персоналните резултати варират според типа устройство и могат да включват:

• вашите контакти, снимки, напомняния, календар и имейли;

• препоръки, като например видеоклипове в YouTube;

• информация от свързаните ви устройства и услуги за здраве и фитнес;

