"Персоналните резултати включват

• вашите контакти, снимки, напомняния, календар и имейли;

• препоръки, като например видеоклипове в YouTube;

• информация от свързаните ви устройства и услуги за здраве и фитнес;

• лични действия, като например плащания и обаждания на контакти.

Винаги можете да персонализирате или изключите персоналните резултати от настройките в приложението Home или Асистент.

Когато попитате за персонални резултати, Асистент ще ви отговори, когато разпознае гласа ви. Това означава, че Асистент няма да отговаря с персонални резултати, освен ако не разпознае гласа ви.

Тези резултати се показват проактивно на устройството ви като известия и на началния екран, без да се налага да питате за тях. На устройства с включена функция Face Match проактивните резултати се показват, когато лицето ви бъде разпознато. Всички могат да виждат, докосват и извършват действия с персоналните резултати, но вие можете да персонализирате кога да се показват тези резултати чрез настройките в приложението Home или Асистент.

Всеки, който се намира пред това устройство, ще вижда проактивните ви персонализирани препоръки, като например за YouTube."

